import React from 'react';
import styled from 'styled-components';
import Grid from '@material-ui/core/Grid';


const MySkills = () => {

    const Wrapper = styled.div`
        position: relative;
        min-height: 100vh;
        width: 100vw;
        padding-top:20px;
    `;

    const LeftWrapper = styled(Grid)`
        padding: 70px;

        @media (max-width: 600px) {
            padding: 30px;
        }
    `;

    const Title = styled.h1`
        font-size: 30px;
        color: #566366;
        text-transform: uppercase;
    `;

    const Paragraph = styled.p`
        color: #919191;
    `;

    const Button = styled.button`
        color: #2ECC71;
        border: 1px solid #2ECC71;
        font-size: 18px;
        padding:10px;
        margin-top: 50px;
        transition: .2s;
        :hover{
            cursor: pointer;
            background-color: #2ECC71;
            color: #ffffff;
        }
    `;

    return(
        <Wrapper>
            <Grid container>
                <LeftWrapper item xs={12} sm={6}>
                    <Title>My skills</Title>
                    <Paragraph>Lorem ipsum dolor sit amet, ea doming epicuri iudicabit nam, te usu virtute placerat. Purto brute disputando cu est, eam dicam soluta ei. Vel dicam vivendo accusata ei, cum ne periculis molestiae pri.<br /> <br /> Lorem ipsum dolor sit amet, ea doming epicuri iudicabit nam, te usu virtute placerat. Purto brute disputando cu est.</Paragraph> 
                    <Button>Contact me</Button>
                </LeftWrapper>
                <Grid item xs={12} sm={6}>

                </Grid>
            </Grid>
        </Wrapper>
    );
}

export default MySkills;
